MongoDB lookup when foreign field is an array<p>I've searched the internet and StackOverflow, but I cannot find the answer or even the question.</p>

<p>I have two collections, <code>reports</code> and <code>users</code>. I want my query to return all reports and indicate if the specified user has that report as a favorite in their array.</p>

<p><strong>Reports Collection</strong></p>

<pre><code>{ _id: 1, name:"Report One"}
{ _id: 2, name:"Report Two"}
{ _id: 3, name:"Report Three"}
</code></pre>

<p><strong>Users Collection</strong></p>

<pre><code>{_id: 1, name:"Mike", favorites: [1,3]}
{_id: 2, name:"Tim", favorites: [2,3]}
</code></pre>

<p><strong>Desired Result for users.name="Mike"</strong></p>

<pre><code>{ _id: 1, name:"Report One", favorite: true}
{ _id: 2, name:"Report Two", favorite: false}
{ _id: 3, name:"Report Three", favorite: true}
</code></pre>

<p>All of the answers I can find use $unwind on the local (<code>reports</code>) field, but in this case the local field isn't an array. The foreign field is the array.</p>

<p>How can I unwind the foreign field? Is there a better way to do this?</p>

<p>I saw online that someone suggested making another collection <code>favorites</code> that would contain:</p>

<pre><code>{ _id: 1, userId: 1, reportId: 1 }
{ _id: 2, userId: 1, reportId: 3 }
{ _id: 3, userId: 2, reportId: 2 }
{ _id: 4, userId: 2, reportId: 3 }
</code></pre>

<p>This method seems like it should be unnessesary. It should be simple to join onto an ID in a foreign array, right?</p>

