Mongoose Populate with Express, not working in production (Heroku)<p>This is a MERN app, hosted on github, and it works <strong>perfectly</strong> on localhost. Unfortunately, it does not work on Heroku. </p>

<p>The issue is the API request, it must return an object and populate an array of OIDs (see Department Model). API request is working. I'm getting the data from MLab, but it <strong>doesn't</strong> <strong>populate</strong>... instead returns: <code>"surveys":[]</code></p>

<p><strong>API File</strong></p>

<pre><code>router.get('/department_data/:d_oid', function(req, res) {
     Department.findOne({_id: req.params.d_oid}).populate("surveys").exec(function(err,doc){
          if(err) throw(err)
          res.send(doc)
     })
});
</code></pre>

<p><strong>Department Model</strong></p>

<pre><code>**Department Model**
var mongoose = require("mongoose");
var Schema = mongoose.Schema;

// Create the survey schema
var departmentSchema = new Schema({

  department_name: {
    type: String,
    trim: true,
    required: true
  },

  surveys: [{
    type: Schema.Types.ObjectId,
    ref: 'Surveys'
  }],

  participants: [{
    type: String
  }],

  create_date: {
    type: Date,
    default: Date.now
  },

  created_by: {
    type: Schema.Types.ObjectId,
    ref: 'Created_By'
  },
});

departmentSchema.index({ department_name: 1, created_by: 1}, {unique: true});

const Department = mongoose.model('Departments', departmentSchema);

module.exports = Department;
</code></pre>

<p><strong>Survey Model</strong></p>

<pre><code>var mongoose = require("mongoose");
var Schema = mongoose.Schema;

// Create the survey schema
var surveySchema = new Schema({

  survey_name: {
    type: String,
    trim: true,
    required: true
  },

  questions: [{
      type: Schema.Types.ObjectId,
      ref: 'Questions'
  }],

  created_date: {
     type: Date,
     default: Date.now
  }
});

const Survey = mongoose.model('Surveys', surveySchema);

module.exports = Survey;
</code></pre>

